import React from 'react'
import './Sidebar.css';
import SidebarRow from './SidebarRow';
function Sidebar() {
    return (
        <div className='sidebar'>
         <SidebarRow title= 'abaad' src='https://cdn4.vectorstock.com/i/1000x1000/34/48/hacker-esport-
         logo-mascot-design-vector-34603448.jpg'/>
         <SidebarRow title= 'friends'/>
         <SidebarRow/>
         <SidebarRow/>
         <SidebarRow/>
        </div>
    )
}

export default Sidebar
